import '../styles/transactions.css';
import { Component } from 'react';
import Transaction from '../components/Transaction';


class Transactions extends Component {
    remove = (vendor) => {
        this.props.remove(vendor)
    }

    saveTransaction = (transaction) => {
        return this.props.saveTransaction(transaction)
    }

    removeTransaction = () => {
        return this.props.removeTransaction()
    }


    render() {

        return (
            <div>
                {this.props.dummyData.map(d => <Transaction key={d.vendor} transaction={d} remove={this.remove} dummyData={this.props.dummyData} saveTransaction={this.saveTransaction} removeTransaction={this.removeTransaction}/>)}

            </div>
        )
    }


}

export default Transactions;
